import airbnbLogo from "../images/airbnb-logo.png";
import photoGrid from "../images/airbnb-pics.png"

function Nav() {
    return (
        <nav>
            <img className="nav--logo" src={airbnbLogo} alt="airbnb logo" />

            <img className="nav-photo_grid" src={photoGrid} alt="airbnb pics"/>
            
        </nav>
    );
}

export default Nav;
